First, we'll define a function that will deploy our contract to the chain. This function will setup the environment (connecting to the chain), deploy the contract, and return a Result with the contract address. // scripts/src/my_contract.rs
use anyhow::Result;
use boot_core::networks;
use boot_core::prelude::{instantiate_daemon_env, NetworkInfo, DaemonOptionsBuilder};
// Traits for contract deployment
use boot_core::interface::*;
use interfaces::my_contract::MyContract; // Select the chain to deploy to
const NETWORK: NetworkInfo = networks::juno::UNI_5;
const CONTRACT_NAME: &str = "my-contract"; pub fn deploy_contract() -> anyhow::Result<String> { // Create a runtime for the asynchronous actions let rt = Arc::new(tokio::runtime::Runtime::new().unwrap()); // Specify the options for the blockchain daemon let options = DaemonOptionsBuilder::default() // or provide `chain_data` .network(NETWORK) .deployment_id("my_deployment_version") .build()?; // Setup the environment let (_, _sender, chain) = instantiate_daemon_env(&rt, options)?; // Create a new instance of your contract interface let contract = MyContract::new(CONTRACT_NAME, &chain); // Upload your contract contract.upload()?; // Instantiate your contract let init_msg = InstantiateMsg { // ... }; // The second argument is the admin, the third is any coins to send with the init message contract.instantiate(init_msg, None, None)?; // Load and return the contract address let contract_addr = contract.address(); Ok(contract_addr)
}

