So you have your contract deployed, but what now? You can write additional scripts to interact with your contract. For example, you can write a script to query the contract state, or to execute a contract method. Here's an example of a script that queries the contract state: // scripts/src/my_contract.rs
// use ...
use my_contract::{QueryMsg};
// ... pub fn query_contract() -> Result<()> { // Setup the environment let rt = Arc::new(tokio::runtime::Runtime::new().unwrap()); let options = DaemonOptionsBuilder::default() .network(NETWORK) .build()?; let (_, _sender, chain) = instantiate_daemon_env(&rt, options)?; // Create a new instance of your contract interface let contract = MyContract::new(CONTRACT_NAME, &chain); // Load the contract address (this will use the address set from the previous deploy script) let contract_addr = contract.address(); // Query the contract let res = contract.query(QueryMsg::Balance { address: contract_addr, })?; // Print the result println!("{:?}", res); Ok(())
} And one that executes a contract method: // scripts/src/my_contract.rs
// use ...
use my_contract::{ExecuteMsg};
// ... pub fn execute_contract() -> Result<()> { // Setup the environment let rt = Arc::new(tokio::runtime::Runtime::new().unwrap()); let options = DaemonOptionsBuilder::default() .network(NETWORK) .build()?; let (_, _sender, chain) = instantiate_daemon_env(&rt, options)?; // Create a new instance of your contract interface let contract = MyContract::new(CONTRACT_NAME, &chain); // Load the contract address (this will use the address set from the previous deploy script) let contract_addr = contract.address(); // Execute a contract method let res = contract.execute(ExecuteMsg::UpdateBalance { address: contract_addr, balance: Uint128::from(1000000u128), })?; // Print the result println!("{:?}", res); Ok(())
}

